DECLARE @SearchString NVARCHAR(100) = 'Cuesta'; -- Replace 'Cuesta' with the string you want to search for

DECLARE @ReplacementString NVARCHAR(100) = 'Curriqunet'; -- Replace 'Curriqunet' with the replacement word


DECLARE @TableName NVARCHAR(128);
DECLARE @ColumnName NVARCHAR(128);
DECLARE @SQL NVARCHAR(MAX);

DECLARE TableCursor CURSOR LOCAL FAST_FORWARD FOR
SELECT TABLE_NAME
FROM INFORMATION_SCHEMA.TABLES
WHERE TABLE_TYPE = 'BASE TABLE';

OPEN TableCursor;
FETCH NEXT FROM TableCursor INTO @TableName;

WHILE @@FETCH_STATUS = 0
BEGIN
    DECLARE @ErrorMessage NVARCHAR(MAX);
    DECLARE @ErrorSeverity INT;
    DECLARE @ErrorState INT;

    BEGIN TRY
        DECLARE ColumnCursor CURSOR LOCAL FAST_FORWARD FOR
        SELECT COLUMN_NAME
        FROM INFORMATION_SCHEMA.COLUMNS
        WHERE TABLE_NAME = @TableName
            AND COLUMN_NAME NOT IN ('active', 'id', 'BeginDate', 'LookupTableQuery', 'CurrentCoursesInCrossListing', 'MetaSelectedSectionId', 'MetaSelectedFieldId', 'MetaTemplateId', 'MeatTemplateTypeId', 'IsCrossListed',
                'SynceSourceId', 'IsCoursePreActive', 'IsCourseDeleted', 'IsCourseRejected', 'CalendarDate', 'CrosslistedCourses', 'MetaTemplateTypeId', 'SyncSourceId') -- Exclude columns
                AND TABLE_NAME NOT IN ('MasterKeyTranslation', 'ClientSettingHelpMenu', 'ErrorLog', 'LastDeployed', 'Audits', 'AuditRunResults', 'ApprovalLevelCompletionStrategy', 'AuthenticationType', 'ClientSetting', 'ImportRunDetail',
                    'ImportActionType', 'MergeTableSource', 'StatusAliasTranslation', 'AggregateTable', 'RowValueChange', 'ChangeBatch', 'AggregateType', 'ObsoleteTable', 'MergeTable', 'TableTranslation', 'MessageTemplate', 'MergeTableOperation',
                    'ColumnToLookup', 'KeyTranslation', 'AgendaReportAttribute', 'ScriptType', 'ColumnTranslation', 'AgendaReportAttributeType', 'AuditRun', 'ImportRun', 'StepLevelTranslation', 'KeyTranslationIgnoreRowOnImport', 'KeyTranslationIgnoreRowOnImport',
                    'MergeTableTranslation', 'ScriptsRunOnDatabase', 'AgendaReportConfiguration', 'AgendaReportEntityGroup', 'ColumnToLookupValue', 'AgendaReportEntityGroupType', 'CustomTranslation', 'AgendaReportLayoutMapping', 'CustomTranslationCategory',
                    'AgendaReportQuery', 'AgendaReportQueryMapping', 'AgendaReportSection', 'AgendaReportLayout', 'PublicSearchStatusAlias', 'ClientImageType', 'ClientSettingImage', 'PublicSearch', 'Implementation', 'Widget', 'Dashboard', 'DashboardWidget', 'SavedSearches','Language', 'MetaData', 
										'TuningSession', 'TuningQuery', 'QueryOptionGroup', 'ExecutionStat')
                AND DATA_TYPE IN ('varchar', 'nvarchar', 'char', 'nchar');

        OPEN ColumnCursor;
        FETCH NEXT FROM ColumnCursor INTO @ColumnName;

        WHILE @@FETCH_STATUS = 0
        BEGIN
            SET @SQL = 'UPDATE ' + QUOTENAME(@TableName) +
                       ' SET ' + QUOTENAME(@ColumnName) +
                       ' = REPLACE(' + QUOTENAME(@ColumnName) +
                       ', ' + QUOTENAME(@SearchString, '''') +
                       ', ' + QUOTENAME(@ReplacementString, '''') +
                       ') WHERE ' + QUOTENAME(@ColumnName) +
                       ' LIKE ' + QUOTENAME('%' + @SearchString + '%', '''') + ';';

            EXEC sp_executesql @SQL;

            FETCH NEXT FROM ColumnCursor INTO @ColumnName;
        END;

        CLOSE ColumnCursor;
        DEALLOCATE ColumnCursor;

        FETCH NEXT FROM TableCursor INTO @TableName;
    END TRY
    BEGIN CATCH
        SET @ErrorMessage = ERROR_MESSAGE();
        SET @ErrorSeverity = ERROR_SEVERITY();
        SET @ErrorState = ERROR_STATE();

        PRINT 'Error occurred while updating table ' + @TableName + '. Message: ' + @ErrorMessage;
        -- Additional error handling code can be added here if needed

        FETCH NEXT FROM TableCursor INTO @TableName; -- Move to the next table
    END CATCH;
END;

CLOSE TableCursor;
DEALLOCATE TableCursor;
