(@ModuleId, 1, '<h2><span style="color:#0066cc;">Career Education Programs</span></h2>

<p>With today&#39;s expanding technology and challenging economy, it&#39;s important that META College provides the community with an educated and well-trained workforce armed with associate degrees and certificates as they head to their future careers. Our wide variety of more than 50 Career Education (CE) programs provide both career course offerings and general education classes designed to prepare students of all ages for in-demand careers, job changes, or advancement needs. Students can also transfer to a four-year college or university to further their education. Both the educational goals of our students and the workforce needs of our community are carefully considered when designing our programs.</p>

<p>Career education disciplines are identified by their icons.</p>

<table align="left" border="0" cellpadding="1" cellspacing="1" class="table">
	<tbody>
		<tr>
			<td style="width: 60%;">
			<h3>Business &amp; Entrepreneurship</h3>

			<div class="rounded-circle p-2 d-inline-block float-start d-flex align-items-center justify-content-center me-3 mt-2 mb-2" style="background-color:#fbb017; min-width:64px; min-height:64px;"><i class="fa fa-chart-line fa-3x text-light"></i></div>
			All companies need qualified people to manage their operations in some way, but there are also plenty of&nbsp; opportunities to start your own business. All of META&rsquo;s programs are designed for students to specialize in a&nbsp; particular area and are especially useful if you are looking for your first job or trying to advance in a current position. So whether you want to&nbsp; move right into the workplace or are planning to transfer to a four-year college to continue your education, there are programs for all interests in the business world.

			<p>&nbsp;</p>
			</td>
			<td>
			<h5>Business &amp; Entrepreneurship Programs</h5>

			<ul style="list-style-type: disc;">
				<li>Accounting</li>
				<li>Business Administration</li>
				<li>Business Management</li>
				<li>Digital Marketing</li>
				<li>Entrepreneurship</li>
				<li>Human Resource Management</li>
				<li>Real Estate</li>
				<li>Retail Management</li>
			</ul>
			</td>
		</tr>
		<tr>
			<td>
			<h3>Environment &amp; Sustainability</h3>

			<div class="rounded-circle p-2 d-inline-block float-start d-flex align-items-center justify-content-center me-3 mt-2 mb-2" style="background-color:#fbb017; min-width:64px; min-height:64px;"><i class="fa fa-globe fa-3x text-light"></i></div>
			One of the first of its kind in the nation, the Environmental Management &amp;&nbsp;&nbsp; Technology program is conveniently located between two wildland&nbsp; watershed open spaces in the Oakland hills that serve as field classrooms,&nbsp; along with the student-built Self-Reliant House. Here students experience hands-on projects that lead to certificates and careers as park rangers and naturalists, environmental restoration technicians, conservation workers, and environmental consultants while working for government agencies, non-profit organizations, and the private sector. Similarly, the wide-open 7-1/2-acre &ldquo;classroom&rdquo; housing the popular Landscape Horticulture program nearby offers multiple degrees and certificates to prepare students for careers that will lead to jobs that are in demand by employers of parks, schools, golf courses, landscape contractors, and tree service companies &mdash; or graduates can become successfully self-employed.</td>
