			<h3>Information &amp; Communication Technology</h3>

			<div class="rounded-circle p-0 d-inline-block float-start d-flex align-items-center justify-content-center me-3 mt-2 mb-2" style="background-color:#fbb017; min-width:64px; min-height:64px;"><i class="bi bi-laptop fa-3x text-light"></i></div>
			Every day we hear about major companies or retailers getting hacked. Now you can be part of the solution by learning to protect computers, networks, programs, and data by joining the rapidly growing field of cybersecurity. The two programs, created by Silicon Valley security experts, give you the option of working in software (Application) or hardware (Infrastructure). Classes are taught by industry professionals alongside META faculty in a hybrid combination of classroom instruction and virtual lab assignments. The hands-on program includes internships at workplaces throughout the Bay Area to give&nbsp; you real-life experience for your first job.

