			The variety of program offerings in Child Development prepares students with the&nbsp; knowledge and opportunities to work with children of different ages in providing quality&nbsp; learning experiences in so many areas and age ranges. The on-campus Lab School provides students with the hands-on experiences of practicing what they learn in a real-life setting. For students seeking entry-level positions in a career where they can help others, the Community Social Services/Substance Abuse program prepares students for paraprofessional positions providing counseling, case management, crisis management,&nbsp; and relapse prevention services.

