			Students in the Administration of Justice Program have the benefit of being taught by&nbsp; instructors from the Oakland Police Department and other law enforcement agencies who provide real-life lessons and hands-on experiences. The program&rsquo;s popular Pre-Academy course prepares students for the rigorous police entry requirement. The Fire Science Program is also taught by practicing professionals as they prepare students for careers as fire fighters or fire investigators. The training can also open doors to jobs in emergency management, homeland security, forensics, and other exciting careers. With a growing need by attorneys for trained paralegals who know substantive law and&nbsp; administrative procedures, the Paralegal Studies program can teach you skills to become&nbsp; successful with only a 27-unit curriculum.

